import { useState } from 'react'

const Home = () => {
    
    useState('mario');

    const handleClick = () => {
        name = "Mario";
    }
    
    return ( 
        <div className="home">
            <h2>Homepage</h2>
            <p>{name}</p>
            <button onClick={handleClick}>Click Me</button>
        </div>
    );
}
 
export default Home;
